SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
drop table if exists chusudung_giaychungnhan;
drop table if exists thuadat;
drop table if exists chusudung;
drop table if exists giaychungnhan;
drop table if exists quihoach;
drop table if exists loaidat;
drop table if exists taikhoan;
set datestyle to 'DMY';
CREATE TABLE loaidat (
maloai varchar(5) NOT NULL PRIMARY KEY,
tenloai varchar(100)
);


CREATE TABLE chusudung
(
  machu varchar(20) NOT NULL PRIMARY KEY,
  loaichu smallint,
  ten varchar(100),
  nam smallint,
  sogiayto varchar(30),
  ngaycap date,
  diachi varchar(255),
  quoctich varchar(255)
);

create or replace function generate_id_chudat() RETURNS trigger AS $$
DECLARE 
 i INTEGER;
 v_machu VARCHAR(6);
 t BOOLEAN;
 prefix char(1);
BEGIN
 	IF NEW.loaichu = 1 THEN 
 		prefix = 'C';
 	ELSE 
 		prefix = 'T'; 
 	END IF;
	i = 1;
	LOOP
		SELECT prefix || lpad(i::text,5,'0') INTO v_machu;
		SELECT true INTO t FROM chusudung WHERE machu = v_machu;
		IF t IS NULL THEN
		  EXIT;
		ELSE i = i + 1;
		END IF;
	END LOOP;
	NEW.machu = v_machu;
 RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER auto_insert_id_chudat
BEFORE INSERT ON chusudung
FOR EACH ROW
WHEN (NEW.machu IS NULL)
EXECUTE PROCEDURE generate_id_chudat();


CREATE TABLE giaychungnhan
(
  shgiaycn character varying(20) NOT NULL,
  ngayki date,
  coquancap character varying(50),
  chinhly integer,
  dtrieng numeric(10,2),
  dtchung numeric(10,2),
  mucdichsudung character varying(5),
  nguongocsudung varchar(255),
  thoihansudung date,
  CONSTRAINT giaychungnhan_pkey PRIMARY KEY (shgiaycn),
  CONSTRAINT giaychungnhan_mucdichsudung_fkey FOREIGN KEY (mucdichsudung)
      REFERENCES loaidat (maloai) MATCH SIMPLE
      ON UPDATE NO ACTION ON DELETE NO ACTION
);

CREATE OR REPLACE FUNCTION random_between(low INT ,high INT) 
   RETURNS INT AS $$
BEGIN
   RETURN floor(random()* (high-low + 1) + low);
END;
$$ language 'plpgsql' STRICT;

create or replace function generate_id_gcn() RETURNS trigger AS $$
DECLARE 
 i INTEGER;
 v_magcn VARCHAR(8);
 t BOOLEAN;
 t1 INTEGER;
 t2 INTEGER;
 prefix char(2);
 alphabet char[26] := ARRAY ['a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z'];
BEGIN
  select random_between(1,26) into t1;
  select random_between(1,26) into t2;
  prefix = alphabet[t1] || alphabet[t2];
  i = 1;
  LOOP
    SELECT upper(prefix) || lpad(i::text,6,'0') INTO v_magcn;
    SELECT true INTO t FROM giaychungnhan WHERE shgiaycn = v_magcn;
    IF t IS NULL THEN
      EXIT;
    ELSE i = i + 1;
    END IF;
  END LOOP;
  NEW.shgiaycn = v_magcn;
 RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER auto_insert_shgcn
BEFORE INSERT ON giaychungnhan
FOR EACH ROW
WHEN (NEW.shgiaycn IS NULL)
EXECUTE PROCEDURE generate_id_gcn();

UPDATE giaychungnhan SET mucdichsudung = 'ODT';

CREATE TABLE chusudung_giaychungnhan (
machu varchar(20) NOT NULL REFERENCES chusudung(machu),
shgiaycn varchar(20) NOT NULL REFERENCES giaychungnhan(shgiaycn),
CONSTRAINT machu_shgiaycn PRIMARY KEY (machu,shgiaycn)
);



CREATE TABLE "thuadat" (gid serial,
"shbando" int4 NOT NULL,
"shthua" int4 NOT NULL,
"dtpl" numeric(10,3),
"sonha" varchar(10),
"tenduong" varchar(50),
"phuong" varchar(50),
"thanhpho" varchar(50),
"tinh" varchar(50),
"shgiaycn" varchar(20) REFERENCES giaychungnhan(shgiaycn));

ALTER TABLE "thuadat" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','thuadat','geom','3857','MULTIPOLYGON',4);
CREATE INDEX ON "thuadat" USING GIST ("geom");

CREATE TABLE "quihoach" (gid serial,
"ma_qh" varchar(10),
"kihieu_qh" varchar(5) REFERENCES loaidat(maloai));
ALTER TABLE "quihoach" ADD PRIMARY KEY (gid);

SELECT AddGeometryColumn('','quihoach','geom','3857','MULTIPOLYGON',2);
CREATE INDEX ON "quihoach" USING GIST ("geom");

CREATE TABLE taikhoan (
	id serial PRIMARY KEY NOT NULL,
	username varchar(255) NOT NULL UNIQUE,
	password varchar(255) NOT NULL DEFAULT '12345',
	hoten varchar(255),
	cmnd varchar(20),
	diachi varchar(255),
	chucvu smallint
);


CREATE TABLE vanbannhanuoc (
	id serial PRIMARY KEY NOT NULL,
	sohieu varchar(50) UNIQUE,
	noidung text,
	link varchar(255)
);
COMMIT;
ANALYZE "thuadat";
ANALYZE "quihoach";